constant "Mint" { EcFixedPoint VALUE_COMMIT_VALUE, EcFixedPoint VALUE_COMMIT_RANDOM,
}; contract "Mint" { Base pub_x, Base pub_y, Base value, Base token, Base serial, Base coin_blind, Scalar value_blind, Scalar asset_blind,
}; circuit "Mint" { # Poseidon hash of the coin C = poseidon_hash(pub_x, pub_y, value, token, serial, coin_blind); constrain_instance(C); # Pedersen commitment for coin's value. vcv = ec_mul_short(value, VALUE_COMMIT_VALUE); vcr = ec_mul(value_blind, VALUE_COMMIT_RANDOM); value_commit = ec_add(vcv, vcr); # Since value_commit is a curve point, we fetch its coordinates # and constrain them. value_commit_x = ec_get_x(value_commit); value_commit_y = ec_get_x(value_commit); constrain_instance(value_commit_x); constrain_instance(value_commit_y); # Pedersen commitment for coin's token ID. tcv = ec_mul_short(token, VALUE_COMMIT_VALUE); tcr = ec_mul(token_blind, VALUE_COMMIT_RANDOM); token_commit = ec_add(tcv, tcr); # Since token_commit is also a curve point, we'll do the same # coordinate dance. token_commit_x = ec_get_x(token_commit); token_commit_y = ec_get_y(token_commit); constrain_instance(token_commit_x); constrain_instance(token_commit_y); # At this point we've enforced all of our public inputs.
}; As you can see, the Mint contract/circuit basically consists of three operations. First one is hashing the coin C, and after that, we create Pedersen commitments for both the coin's value and the coin's token ID . On top of the zkas code, we've declared two constant values that we are going to use for multiplication in the commitments. The constrain_instance call can take any of our assigned variables and enforce a public input . Public inputs are an array (or vector) of values used as public inputs by verifiers to verify a zero knowledge proof. In the above case of the Mint contract, since we have five calls to constrain_instance, we would also have an array of five elements that represent these public inputs. The array's order must match the constrain_instance calls since they will be constrained by their index in the array (which is incremented for every call). In other words, the vector of public inputs could look like this: let public_inputs = vec![ coin, *value_commitment_coords.x(), *value_commitment_coords.y(), *token_commitment_coords.x(), *token_commitment_coords.y(),
]; And then the Verifier uses these public inputs to verify a given zero knowledge proof.

