}; contract "Burn" { Base secret, Base serial, MerklePath path, Base leaf, Base value, Base token, Scalar value_blind, Scalar token_blind, Base signature_secret,
}; circuit "Burn" { # Poseidon hash of the Nullifier nullifier = poseidon_hash(secret, serial); constrain_instance(nullifier); # Merkle root root = calculate_merkle_root(path, leaf); constrain_instance(root); # Pedersen commitment for coin's value vcv = ec_mul_short(value, VALUE_COMMIT_VALUE); vcr = ec_mul(value_blind, VALUE_COMMIT_RANDOM); value_commit = ec_add(vcv, vcr); # Since value_commit is a curve point, we fetch its coordinates # and constrain them. value_commit_x = ec_get_x(value_commit); value_commit_y = ec_get_y(value_commit); constrain_instance(value_commit_x); constrain_instance(value_commit_y); # Pedersen commitment for coin's token ID tcv = ec_mul_short(token, VALUE_COMMIT_VALUE); tcr = ec_mul(token_blind, VALUE_COMMIT_RANDOM); token_commit = ec_add(tcv, tcr); # Since token_commit is also a curve point, we'll do the same # coordinate dance. token_commit_x = ec_get_x(token_commit); token_commit_y = ec_get_y(token_commit); constrain_instance(token_commit_x); constrain_instance(token_commit_y); # Finally, we derive a public key for the signature and # constrain its coordinates. signature_public = ec_mul(signature_secret, NULLIFIER_K); signature_x = ec_get_x(signature_public); signature_y = ec_get_y(signature_public); constrain_instance(signature_x); constrain_instance(signature_y); # At this point we've enforced all of our public inputs.
}; The Burn contract/circuit consists of operations similar to the Mint circuit, with the addition of Merkle root calculation. In the same manner, we're doing a Poseidon hash instance, we're building Pedersen commitments for the value and token ID, and finally we're doing a public key derivation. In this case, our vector of public inputs could look like: let public_inputs = vec![ nullifier, *value_commitment_coords.x(), *value_commitment_coords.y(), *token_commitment_coords.x(), *token_commitment_coords.y(), merkle_root, *signature_coords.x(), *signature_coords.y(),
